-- Downloaded Dataset
select ogc_fid, st_srid(wkb_geometry), osm_id, code, fclass, name from poi
where name is not null;

-- Table Food and Drinks
CREATE TABLE FoodNDrinks (
    ogc_fid integer PRIMARY KEY NOT NULL,
    wkb_geometry GEOMETRY (Point,4326),
    fclass character varying(28),
    name character varying(100)
);

INSERT INTO FoodNDrinks (ogc_fid, wkb_geometry, fclass, name)
select ogc_fid, wkb_geometry, fclass, name from poi
where name is not null
and code in (2301,2302,2303,2304,2305,2306,2307); -- food drinks 33144

CREATE INDEX idx_FoodNDrinks ON FoodNDrinks USING gist (wkb_geometry);

-- Add a 'Rating' column to the 'Food_and_Drink' table with random values between 3.0 and 5.0
ALTER TABLE FoodNDrinks
ADD COLUMN rating NUMERIC DEFAULT CAST((1.0 + random() * 4) AS NUMERIC(3,1));

